import React, {useEffect, useState} from 'react';
import './Circle.css';




const Circle = (props) => {

    console.log(props.course);

    return (<div><button className="circle-container">

        <b>{props.course}</b>

        </button>
        <button className="circle-display">
            Test
        </button>
        </div>
    );

    // on press: become larger (w no respect for margins and large shadows)

};

export default Circle;
